import React from "react"

function ProjectSlides(props){
    return (
        <a href={props.link}>
<img className="overflow-hidden" onMouseEnter={props.mouseenter} onMouseLeave={props.mouseleave} className={props.classname} src={props.img} alt={props.alt} />
</a>
    )
}

export default ProjectSlides
